    def preprocess_data(self, data: Dict[str, Any]) -> Dict[str, Any]:
        if 'laser_values' not in data or len(data['laser_values']) != 4:
            return {'error': '4개의 레이저 변화량이 필요합니다'}

        for port, change in enumerate(data['laser_values']):
            self.laser_changes[port].append(change)

        if all(len(self.laser_changes[i]) >= 1 for i in range(4)):
            return {'processed': True}
        else:
            return {'error': '모든 포트의 변화량이 입력되지 않았습니다'}

    def calculate_cog_ratios(self):
        top_left = sum(self.laser_changes[0]) / len(self.laser_changes[0]) if self.laser_changes[0] else 0
        top_right = sum(self.laser_changes[2]) / len(self.laser_changes[2]) if self.laser_changes[2] else 0
        bottom_left = sum(self.laser_changes[1]) / len(self.laser_changes[1]) if self.laser_changes[1] else 0
        bottom_right = sum(self.laser_changes[3]) / len(self.laser_changes[3]) if self.laser_changes[3] else 0

        vcog = top_left / (top_left + bottom_left) if (top_left + bottom_left) != 0 else 0
        hcog = top_left / (top_left + top_right) if (top_left + top_right) != 0 else 0

        return vcog, hcog

    def determine_loading_position(self):
        vcog, hcog = self.calculate_cog_ratios()

        if vcog > 0.50:
            vertical_position = "front"
        elif 0.29 <= vcog <= 0.50:
            vertical_position = "center"
        else:
            vertical_position = "rear"

        if hcog > 0.58:
            horizontal_position = "Left"
        elif 0.29 <= hcog <= 0.58:
            horizontal_position = "Middle"
        else:
            horizontal_position = "Right"

        location = f"{vertical_position}{horizontal_position}"
        return location

    def calculate_weight_estimation(self, location):
        mapping = {
            "frontLeft": self.laser_changes[0],
            "frontMiddle": [(sum(self.laser_changes[0]) + sum(self.laser_changes[2])) / 2],
            "frontRight": self.laser_changes[2],
            "centerLeft": [(sum(self.laser_changes[0]) + sum(self.laser_changes[1])) / 2],
            "centerMiddle": [(sum(self.laser_changes[0]) + sum(self.laser_changes[1]) +
                              sum(self.laser_changes[2]) + sum(self.laser_changes[3])) / 4],
            "centerRight": [(sum(self.laser_changes[2]) + sum(self.laser_changes[3])) / 2],
            "rearLeft": self.laser_changes[1],
            "rearMiddle": [(sum(self.laser_changes[1]) + sum(self.laser_changes[3])) / 2],
            "rearRight": self.laser_changes[3]
        }

        if location in self.constants and location in mapping:
            avg = sum(mapping[location]) / len(mapping[location]) if mapping[location] else 0
            closest = min(self.constants[location], key=lambda x: abs(x - avg))
            return self.constants[location].index(closest)
        return None

    def process(self) -> Dict[str, Any]:
        if 'error' in self.input_data:
            return self.input_data

        location = self.determine_loading_position()
        estimated_weight = self.calculate_weight_estimation(location)

        return {
            'position': location,
            'weight': estimated_weight
        }

    def execute(self, input_data: Optional[Dict[str, Any]] = None) -> Dict[str, Any]:
        try:
            self.is_running = True
            start_time = time.time()

            if input_data:
                self.input_data = self.preprocess_data(input_data)

            if 'error' in self.input_data:
                return self.input_data

            result = self.process()
            self.output_data = result
            self.execution_time = time.time() - start_time

            self.execution_history.append({
                'timestamp': time.time(),
                'input_keys': list(self.input_data.keys()),
                'output_keys': list(self.output_data.keys()),
                'execution_time': self.execution_time
            })

            return self.output_data

        except Exception as e:
            return {'error': f'알고리즘 실행 중 오류: {str(e)}'}
        finally:
            self.is_running = False


